  \"[\"Access Constraints: To access sensitive data a completed non-disclosure agreement
  must be on file with NOAA-SEFSC. Otherwise Data that are submitted as sensitive
  can be released to the public under the following circumstances:nn1. Combined or
  aggregated data. Sensitive data can be released if the data are aggregated or summarized
  in a manner that prevents the identification of the person or organization that
  submitted the data. The \"rule of three\" and identification of majority allocations\"
  are the primary data suppression methods.nn2. Obscure (scramble) or remove the data
  identifier. For some types of data, sensitive data Can be released as non-sensitive
  if the identity of the person, vessel, company, etc. that submitted the data is
  not included or is scrambled as part of the data that are released.nn3. Submitter.
  Sensitive data collected under federal authority Can be released to the original
  entity (person, vessel, business, etc.) that submitted the data.nn4. Sensitive data
  waived. The protection of sensitive data can be waived by the person or business
